using SeedEndpointSecurityAuth;

var client = new SeedEndpointSecurityAuthClient(
    "TOKEN",
    "API_KEY",
    "client_id",
    "client_secret",
    "USERNAME",
    "PASSWORD"
);
await client.Auth.GetTokenAsync(
    new GetTokenRequest
    {
        ClientId = "client_id",
        ClientSecret = "client_secret",
        Audience = "https://api.example.com",
        GrantType = "client_credentials",
    }
);

